sys_variable_value.value:
(function execute(inputs, outputs) {
    var ghUtils = new DM_GitHubUtils();
    var sysId = ghUtils.parseAppSysId(inputs.name);
    if (sysId) {
        outputs.sysid = sysId;
    }
})(inputs, outputs);

